window.bookSummaryJSON = "<p>Book one in the blockbuster <i>Maze Runner</i> series that spawned a movie franchise and ushered in a worldwide phenomenon! And don’t miss <i>The Fever Code</i>, the highly-anticipated series conclusion that finally reveals the story of how the maze was built! When Thomas wakes up in the lift, the only thing he can remember is his name. He’s surrounded by strangers - boys whose memories are also gone. </p> <p>Outside the towering stone walls that surround them is a limitless, ever-changing maze. It’s the only way out - and no one’s ever made it through alive. Then a girl arrives. The first girl ever. And the message she delivers is terrifying: Remember. Survive. Run. </p> <p><i>The Maze Runner </i>and <i>Maze Runner: The Scorch Trials</i>, and<i> Maze Runner: The Death Cure</i> all are now major motion pictures featuring the star of MTV's <i>Teen Wolf</i>, Dylan O’Brien; Kaya Scodelario; Aml Ameen; Will Poulter; and Thomas Brodie-Sangster. </p> <p>Also look for James Dashner’s edge-of-your-seat Mortality Doctrine series! </p> <p>Praise for the Maze Runner series: </p> <p>A number one <i>New York Times</i> best-selling series </p> <p>A <i>USA Today</i> best seller </p> <p>A <i>Kirkus Reviews</i> Best Teen Book of the Year </p> <p>An ALA-YASLA Best Fiction for Young Adults Book An ALA-YALSA Quick Pick </p> <p>“[A] mysterious survival saga that passionate fans describe as a fusion of Lord of the Flies, The Hunger Games, and Lost.” (<i>EW</i>) </p> <p>“Wonderful action writing - fast-paced…but smart and well observed.” (<i>Newsday</i>)</p> <p>“[A] nail-biting must-read.” (<i>Seventeen</i>) </p> <p>“Breathless, cinematic action.” (<i>Publishers Weekly</i>) </p> <p>“Heart pounding to the very last moment.” (<i>Kirkus Reviews</i>) </p> <p>“Exclamation-worthy.” (<i>Romantic Times</i>) </p> <p>“James Dashner’s illuminating prequel [<i>The Kill Order</i>] will thrill fans of this Maze Runner [series] and prove just as exciting for readers new to the series.” (<i>Shelf Awareness</i>, starred) </p> <p>“Take a deep breath before you start any James Dashner book.” (<i>Deseret News</i>) </p>"; 
